using System;\nusing System.Collections;\nusing System.IO;\n\nprivate static Hashtable importFile(Hashtable myHashtable, String myFileName)\n{\n    StreamReader sr = new StreamReader(myFileName);\n    CSVReader csvReader = new CSVReader();\n    ArrayList duplicateKeys = new ArrayList();\n    int count = 0;\n\n    while (!sr.EndOfStream)\n    {\n        String temp = sr.ReadLine();\n        if (temp.StartsWith(" "))\n        {\n            // Add to some list if needed\n        }\n        else\n        {\n            ArrayList tempArray = csvReader.CSVParser(temp);\n            Boolean first = true;\n            String key = "";\n            String value = "";\n\n            foreach (String x in tempArray)\n            {\n                if (first)\n                {\n                    key = x;\n                    first = false;\n                }\n                else\n                {\n                    value += x + ",";\n                }\n            }\n\n            try\n            {\n                myHashtable.Add(key, value);\n            }\n            catch (ArgumentException)\n            {\n                // Key already exists, add to duplicate keys list\n                duplicateKeys.Add(key);\n            }\n        }\n        count++;\n    }\n\n    Console.WriteLine("Import Count: " + count);\n    Console.WriteLine("Duplicate Keys: " + string.Join(", ", duplicateKeys.ToArray()));\n    return myHashtable;\n}